    function expire_list_values() {

        /* declare an checkbox array */
        var chkArray = [];

        /* look for all checkboes that have a class 'chk' attached to it and check if it was checked */
        $(".expir_chk:checked").each(function () {
            chkArray.push($(this).val());
        });

        /* we join the array separated by the comma */
        var selected;
        selected = chkArray.join(',');

        /* check if there is selected checkboxes, by default the length is 1 as it contains one single comma */
        if (selected.length > 0) {
            $('.sonu-button').button('loading');
            $.post(ajax_url, {action: 'dwt_ajax_renew_listings', listng_ids: selected}).done(function (response) {
                $('.sonu-button').button('reset');
                var get_r = response.split('|');
                if ($.trim(get_r[0]) == '1') {
                    $.alert({
                        title: get_strings.congratulations,
                        closeIcon: true,
                        rtl: yes_rtl,
                        icon: 'fa fa-smile-o',
                        theme: 'modern',
                        animation: 'scale',
                        type: 'green',
                        content: get_r[1],
                        buttons: {okay: {btnClass: 'btn-blue'}}
                    });
                    window.setTimeout(function () {
                        location.reload();
                    }, 1500);
                } else {
                    $.alert({
                        title: get_strings.whoops,
                        rtl: yes_rtl,
                        icon: 'fa fa-frown-o',
                        theme: 'modern',
                        animation: 'scale',
                        type: 'red',
                        closeIcon: true,
                        backgroundDismiss: true,
                        content: get_r[1],
                        buttons: {okay: {btnClass: 'btn-blue'}}
                    });
                }
            });
        } else {
            $.alert({
                title: get_strings.whoops,
                rtl: yes_rtl,
                icon: 'fa fa-frown-o',
                theme: 'modern',
                animation: 'scale',
                type: 'red',
                closeIcon: true,
                backgroundDismiss: true,
                content: get_strings.fil_checkbox,
                buttons: {okay: {btnClass: 'btn-blue'}}
            });
        }
    }

