    // 
    function otvetRead(CurQuestion, numberAnswer, statusOtveta){
        let biletType = localStorage.getItem('biletType');
        let biletNum = localStorage.getItem('biletNum');
        //     
        let allQuestions = JSON.parse(localStorage.getItem("statistica")); 
            switch(biletType) {
            case 'AB': 
            typeID = 0;
            break;
          
            case 'C':  
            typeID = 1;
            break;
          
            case 'D':  
            typeID = 2;
            break;
            case 'E':  
            typeID = 3;
            break;
          }
        let curQuestionArray = allQuestions[typeID][0][biletType][0][biletNum][CurQuestion];
        let curQuestionArray1 = JSON.parse(localStorage.getItem("curQuestionsArr"));
        curQuestionArray.answered = true;
        curQuestionArray.answer = numberAnswer;
        curQuestionArray1[CurQuestion].answered = true;
        curQuestionArray1[CurQuestion].answere = true;
        curQuestionArray1[CurQuestion].answer = numberAnswer;
        if (statusOtveta == false){
            myHardQuestions[typeID][biletType][biletNum] = biletNum;
            myHardQuestions[typeID][biletType][biletNum][CurQuestion] = true;
        }
        localStorage.setItem('hardQuestions',JSON.stringify(myHardQuestions))
        localStorage.setItem('statistica',JSON.stringify(allQuestions));
        localStorage.setItem('curQuestionsArr',JSON.stringify(curQuestionArray1));
        proverkaTestResuil();
    }

    //   
    function proverkaTestResuil(){
        //   
        let curVariantArray = JSON.parse(localStorage.getItem("curQuestionsArr"));
        //   ,   
        let counterQuestions = 0;
        for(i=0; i<curVariantArray.length; i++) {
            if (curVariantArray[i].answered == true){
                counterQuestions++;
            }
        }
        console.log(counterQuestions);
        if(counterQuestions == curVariantArray.length){
            contentMain.innerHTML = '';
            contentMain.innerHTML = resultat.innerHTML;
            document.querySelector('#resultat').style = 'display: block;';
        }
        
        let contTrue = 0;
        let contFalse = 0;
        for(i=0; i<curVariantArray.length; i++){
            if(curVariantArray[i].answered == true){
                contTrue++;
            } else {
                contFalse++;
            }
        }
        document.querySelector("#countTrue").innerHTML = contTrue;
        document.querySelector("#countFalse").innerHTML = contFalse;
        
    }

